import React from 'react';
import calender from '../../Images/calender.png';
import bag from '../../Images/bag.png';
import './DivA.css';

export default function DivA(){
    return(
        <>
           <div className="top">
                  <div className="left">
                     <span><img src={calender} alt="" /></span>
                     Fri, 12 Oct, 2018
                  </div>
                  <div className="right">
                    <span><img src={bag} alt="" /></span>
                    Ahmedabad, India
                  </div>
           </div>
           <div className="bottom">
                <div className="bar">
                    Visit Website
                </div>
           </div>
        </>
    )
}
